import time

class Stack:

    def __init__(self, stack):
        self.stack = stack

    def __iter__(self):
        self.count = -1
        return self

    def __next__(self):
        self.count += 1
        if len(self.stack) > self.count+1:
            if self.stack[self.count] + self.stack[self.count+1] in ['[]', '{}', '()']:
                del self.stack[self.count]
                del self.stack[self.count]
                self.count = -1
        else:
            raise StopIteration

    def is_empty(self):
        try:
            if self.stack[0]:
                return True
        except:
            return False

    def push(self, el):
        self.stack.append(el)

    def pop(self):
        return self.stack.pop(-1)

    def peek(self):
        return self.stack[-1]

    def size(self):
        return len(self.stack)


